import React from 'react';
import './Packages.css';

const packages = [
  { id:1, name:'Dubai Luxury Tour', price:'₹1,20,000', duration:'5N/6D', category:'International' },
  { id:2, name:'Kerala Backwaters', price:'₹25,000', duration:'3N/4D', category:'Domestic' },
  {id:3, name:'japan', price:'₹2,50,000', duration:'3N/4D', category:'Domestic'}
];

export default function Packages() {
  return (
    <div className="page packages-page">
      <h2>Packages</h2>
      <table className="table">
        <thead><tr><th>ID</th><th>Name</th><th>Category</th><th>Duration</th><th>Price</th></tr></thead>
        <tbody>
          {packages.map(p => (
            <tr key={p.id}>
              <td>{p.id}</td><td>{p.name}</td><td>{p.category}</td><td>{p.duration}</td><td>{p.price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
